function transliterate(s) {
   let s1 = s.normalize("NFD");
   let s2 = "";
   for (const c of s1) {
       let c2 = translit.get(c)
       if (c2 == null) c2 = c;
       s2 += c2;
   }
   if (s1 == s2)
      s2 = s;   // return the original non-normalized text
   return s2;
}
